import { useState } from 'react';
import './App.css';

function App() {
  const [taskname, settaskname] = useState('');

  return (
    <div>
      <div className='input-area'>
        <p>タスクを追加</p>
        <input placeholder='タスク名を入力' value={taskname} />
        <button>追加</button>
      </div>
      <div className='todo-list'>
        <p>ToDoリスト</p>
        <div>
          <p>タスク1</p>
          <button>完了</button>
        </div>
      </div>
      <div className='done-list'>
        <p>Doneリスト</p>
        <div>
          <p>タスク2</p>
          <button>戻す</button>
        </div>
      </div>
    </div>

  );
}

export default App;
